import AppBar from "@material-ui/core/AppBar";
import Toolbar from "@material-ui/core/Toolbar";
import "../index.css";
import { makeStyles, Typography } from "@material-ui/core";
import { NavLink } from "react-router-dom";
import {theme, Styles} from '@material-ui/core';



const styles = theme => ({
  root: {
    backgroundColor: 'blue',
    // Match [0, md + 1)
    //       [0, lg)
    //       [0, 1280px)
    [theme.breakpoints.down('md')]: {
      backgroundColor: 'red',
    },
  },
});

const useStyles = makeStyles({
  nav: {
    backgroundColor: "palevioletred",
    display:'flex',
   
  },
  Logo: {
    fontFamily: "Kaushan Script",
    flexGrow:'1'
  },
  navItems:{
    textDecoration:'none',
    
    display:'block',
    paddingRight:'15px',
    paddingLeft:'15px',
    color:"#fefefe",
    fontFamily:'Ubuntu'
  },
  
});







const Navbar = () => {
  const classes = useStyles();
  return (
    <div>
      <AppBar className={classes.nav}>
        <Toolbar>
          <Typography className={classes.Logo} variant="h4">
            Flicker Trinket
          </Typography>
         
          <NavLink className={classes.navItems} to='/'>
            Home
          </NavLink>
          <NavLink className={classes.navItems} to='/products'>
            Products
          </NavLink>
          <NavLink className={classes.navItems} to='/services'>
            Services
          </NavLink>
          <NavLink className={classes.navItems} to='about'>
            About Us
          </NavLink>
        </Toolbar>
      </AppBar>
    </div>
  );
};

export default Navbar;
